import React, { useEffect, useState } from 'react'
import axios from "axios"


const Data = () => {

    const [data, SetData] = useState([])

    const fetchData = async () => {
        try {
            const response = await axios.get("https://raw.githubusercontent.com/UjwalNizzCorp/NizzCorp_MachineTasks/refs/heads/main/flutter_task/api/tasks.json")
            SetData(response?.data)
            console.log(response)
        } catch (err) {
            console.log(err)
        }
    }

    useEffect(() => {
        fetchData()
    }, [])

    return (
        <div className="data-container">
            {data && data.length > 0 ? (
                <div>
                    {data?.map((item, index) => (
                        <div key={index} className="date-container">
                            <p className="date-text">{item?.date}</p>
                            {item?.tasks?.map((subitem, subindex) => (
                                <div key={subindex} className="task-container">
                                    <p className="task-title">{subitem?.title}</p>
                                    <p className="task-description">{subitem?.description}</p>
                                    <div>
                                        {  console.log(subitem)}
                                        {
                                          
                                            subitem?.subtasks?.map((inner,index)=>(
                                                <div style={{backgroundColor:"red"}}>
                                                    <p>{inner?.subtasks?.description}</p>
                                                    </div>
                                            ))
                                        }
                                    </div>
                             
                                </div>
                             
                            ))}
                        </div>
                    ))}
                </div>
            ) : (
                <div className="no-data">No data found</div>
            )}
        </div>
    )
}

export default Data;
